  "/home": "首页",
  "/category": "分类",
  "/cart": "购物车",
  "/user": "我的",
};

export default () => (
  <div className={styles.bottom}>
    {iconPaths.map((path) => (
      <Icon key={path} path={path} />
    ))}
  </div>
);
